import logo from './logo.svg';
import './App.css';
import MyInfo from './components/MyInfo/MyInfo';

function App() {
  return (
    <div className="App">
      <div className="container d-flex justify-content-between">
        <MyInfo name="Bill Murray" desription="Bill Murray is an American actor, comedian, and writer. The fifth of nine children, he was born William James Murray in Wilmette, Illinois, to Lucille (Collins), a mailroom clerk, and Edward Joseph Murray II, who sold lumber."/>

      </div>
    </div>
  );
}

export default App;
